 The user clicks login button after entering only username from sheetname \"<Sheetname>\" and row <rownumber>\r\n Then The error message \"Please fill out this field.\" appears below Pwd textbox\r\n  Examples: \r\n      | Sheetname | rownumber  |\r\n      | Login     | 6          |\r\n      \r\nScenario Outline: DS Algo Sign in Page  with blank username\r\n Given  The user is on the DS Algo Sign in Page\r\n When The user clicks login button after entering only password from sheetname \"<Sheetname>\" and row <rownumber>\r\n Then The error message \"Please fill out this field.\" appears below Username textbox\r\n  Examples: \r\n      | Sheetname | rownumber  |\r\n      | Login     | 6          |\r\n \r\nScenario Outline: DS Algo Sign in Page with invalid username and password\r\n Given  The user is on the DS Algo Sign in Page\r\n When The user clicks login button after entering invalid username and invalid password from sheetname \"<Sheetname>\" and row <rownumber>\r\n Then The user should able to see an error message \"Invalid Username and Password\".\r\n  Examples: \r\n      | Sheetname | rownumber  |\r\n      |Login      |   4        |\r\n      \r\nScenario Outline: DS Algo Sign in Page with valid username and invalid password\r\n Given  The user is on the DS Algo Sign in Page\r\n When The user clicks login button after entering valid userName and invalid password from sheetname \"<Sheetname>\" and row <rownumber>\r\n Then The user should able to see an error message \"Invalid Username and Password\".\r\n  Examples: \r\n      | Sheetname | rownumber  |\r\n      |Login      |     7      |\r\n      \r\nScenario Outline: DS Algo Sign in Page  with valid username and Valid password\r\n Given  The user is on the DS Algo Sign in Page\r\n When The user clicks login button after entering valid userName and password from sheetname \"<Sheetname>\" and row <rownumber>\r\n Then user lands on the home page as signedIn\r\n  Examples: \r\n      | Sheetname | rownumber  |\r\n r\n    Then The user is on the Implimentation of Queue in Python page\r\n\r\n  Scenario: Validate user can open try editor page from Implementation of Queue in python\r\n    Given The user on implementation Queue in python page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try editor for Implementation of Queue in python\r\n    Given The user on implementation Queue in python page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation of Queue in python\r\n    Given The user on implementation Queue in python page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: Valid code on try editor for Implementation of Queue in python runs successfully\r\n    Given The user on implementation Queue in python page\r\n    When User writes valid code and clicks run button\r\n    Then The user should able to see output in the console\r\n\r\n  Scenario: Validate user can navigate to Implementation using collections.deque\r\n    Given The user is on Queue Details page\r\n    When The user click on Implementation using collections.deque link\r\n    Then the user is navigated to Queue in collections.deque\r\n\r\n  Scenario: Validate user can open try editor page from Implementation using collections.deque\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try editor for Implementation using collections.deque\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation using collections.deque\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation using collections.deque runs successfully\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User writes valid code and clicks run button\r\n    Then The user should able to see output in the console\r\n\r\n  Scenario: Validate user can navigate to Implementation using collections.deque\r\n    Given The user is on Queue Details page\r\n    When The user click on Queue Operations\r\n    Then the user is navigated to Queue Operations Page\r\n\r\n  Scenario: Validate user can open try editor page from Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try editor for Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation using collections.deque runs successfully\r\n    Given The user is on Queue Operations page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: Validate user can navigate to Implementation using collections.deque\r\n    Given The user is on Queue Details page\r\n    When The user click on Implementation using array link\r\n    Then the user is navigated to Implementation using array page\r\n\r\n  Scenario: Validate user can open try editor page from Implementation using collections.deque\r\n    Given The user is on Implementation using array page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try editor for Implementation using collections.deque\r\n    Given The user is on Implementation using array page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation using collections.deque\r\n    Given The user is on Implementation using array page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation using collections.deque runs successfully\r\n    Given The user is on Implementation using array page\r\n    When User writes valid code and clicks run button\r\n    Then The user should able to see output in the console\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Projects\/newFolder-3\/Repo1\/src\/test\/resources\/Features\/QueueDetails.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Queue Details page","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"Login and navigate to Queue page","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"T ion page\r\n    Given The user is on the new user registration page\r\n   \r\nScenario Outline: New user registration page with all fields empty and Register button is clicked\r\n    When The user clicks Register button with all fields empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error Please fill out this field appears below Username textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         0 | \r\n    \r\n  Scenario Outline: New user registration page with only username entered\r\n    When The user clicks Register button after entering Username with other fields empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error message Please fill out this field. appears below Password textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         1 | \r\n    \r\n   \r\n  Scenario Outline: New user registration page with only username and password fields entered\r\n    When The user clicks Register button after entering Username and password with Password Confirmation field empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error message Please fill out this field. appears below Password Confirmation textbox\r\n   Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         2 |\r\n       \r\n  Scenario Outline: New user registration page with username entered with a space inbetween\r\n    When The user clicks Register button after entering a username with spacebar characters other than digits and symbols on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed with error msg after entering invalid data and redirects to empty username textbox\r\n  Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         3 |   \r\n   \r\n  Scenario Outline: New user registration page with valid username but only numeric password and confirm password\r\n    When The user clicks Register button after entering a password with only numeric data on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed the appropriate error msg after entering invalid data and redirects to empty confirm password textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         4 | \r\n      \r\n    \r\n  Scenario Outline: New user registration page with valid username but password and confirm password fields has less than eight characters\r\n    When The user clicks Register button after entering a Password with characters less than eight on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed the appropriate error msg after entering invalid data and  redirects to empty password confirm textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         5 | \r\n    \r\n   \r\n  Scenario Outline: New user registration page on registration with different passwords entered in password and confirm password fields\r\n    When The user clicks Register button after entering different passwords in Password and Password Confirmation fields form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed with a warning message password_mismatch:The two password fields didnt match.\r\n   Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         6 |  \r\n   \r\n  Scenario Outline: New user registration page with all valid credentials entered\r\n    When The user clicks Register button after user fills registration form from sheetname \"<Sheetname>\" and row <RowNumber> \r\n    Then The user is redirected to Home Page of DS Algo with success message - New Account Created. You are logged in as username on the DS Algo Home Page\r\n     Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         7 | \r\n      \r\n  Scenario Outline: New user registration page where login button is clicked\r\n    When User clicks on login button from registration page\r\n    Then user lands on login page\r\n    \r\n  Scenario Outline: New user registration page where SignIn button is clicked\r\n    When User clicks on SignIn button from registration page\r\n    Then user lands on login page\r\n    ","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Projects\/newFolder-3\/Repo1\/src\/test\/resources\/Features\/Registration.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Registration","description":" I want to use this template for my feature file","children":[{"background":{"location":{"line":5,"column":3},"keyword":"Background","name":"New user registration page","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on the new user registration page","id":"f98725cb-595b-4238-94ee-3af328d4b167"}],"id":"74723173-4c6d-4a85-bc0d-44f2110096a2"}},{"scenario":{"location":{"line":8,"column":1},"tags":[],"keyword":"Scenario Outline","name":"New user registration page with all fields empty and Register button is clicked","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"The user clicks Register button with all fields empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>","id":"ca1701fa-7e67-4b6a-8f22-c9d619bbdd89"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The error Please fill out this field appears below Username textbox","id":"61e52c0d-37ef-4e13-9ea9-64514ed0db98"}],"examples":[{"location":{"line":11,"column":5},"tags":[],"keyword":"Examples","name":"","description":"","tableHeader":{"location":{"line":12,"column":7},"cells":[{"location":{"line":12,"column":9},"value":"Sheetname"},{"location":{"line":12,"co
